import React from "react";
import './Servicos.css'

function Servicos(){
    return(
        <section className="servicos">
            <h1>Serviços</h1>
            <img src="/imagens/servs.jpg" id="a"/>

            <p id="html">HTML é uma linguagem de marcação utilizada na construção de páginas na Web. Documentos HTML podem ser interpretados por navegadores. A tecnologia é fruto da junção entre os padrões HyTime e SGML. HyTime é um padrão para a representação estruturada de hipermídia e conteúdo baseado em tempo</p>
            <p id="css">Cascading Style Sheets é um mecanismo para adicionar estilos a uma página web, aplicado diretamente nas tags HTML ou ficar contido dentro das tags 'style'. Também é possível, adicionar estilos adicionando um link para um arquivo CSS que contém os estilos.</p>
            <p id="js">JavaScript é uma linguagem de programação interpretada estruturada, de script em alto nível com tipagem dinâmica fraca e multiparadigma. Juntamente com HTML e CSS, o JavaScript é uma das três principais tecnologias da World Wide Web.</p>
        </section>
        )
}

export default Servicos
